import { Link } from "wouter";
import "./Header.css"

export default function Header(){

    const isLogged = false;


    return(
        <header className="header">
          {  isLogged? <Link to="/login">
            Login 
            </Link>:
            <h1>is not logge</h1>}
        </header>
    )
}
